"   <div class=\"block pha drugH1Div\" id=\"F226720\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     An essential coenzyme in carbohydrate metabolism by combining with adenosine triphosphate to form thiamine pyrophosphate",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F226736\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Oral: Adequate; I.M.: Rapid and complete",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: Highest concentrations found in brain, heart, kidney, liver",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (as unchanged drug and as pyrimidine after body storage sites become saturated)",
"    </p>",
"   </div>",
"  </div>",
