var title_f0_9_154="ACC AHA evaluation TR";
var content_f0_9_154=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F63208&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F63208&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ACC/AHA guideline summary: Evaluation of tricuspid regurgitation (TR) in adolescents and young adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Class I - There is evidence and/or general agreement that the following tests should be obtained in adolescents and young adults with TR",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Electrocardiogram at the initial evaluation and serially every one to three years, depending upon severity.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Chest radiograph at the initial evaluation and serially every one to three years, depending upon severity.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Doppler echocardiography at the initial evaluation and serially every one to three years, depending upon severity.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; If an atrial communication is present, pulse oximetry at rest and/or during exercise at the initial evaluation and serially every one to three years, depending upon severity.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Class IIa - The weight of evidence or opinion is in favor of the usefulness of the following tests in adolescents and young adults with TR",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Electrophysiology study for symptomatic atrial arrhythmias.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Exercise testing at the initial evaluation and serially every one to three years.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Class IIb - The weight of evidence or opinion is less well established for the usefulness of the following tests in adolescents and young adults with TR",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Among asymptomatic patients, Holter monitoring at the initial evaluation and serially every one to three years.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Bonow RO, Carabello BA, Chatterjee K, et al. ACC/AHA 2006 guidelines for the management of patients with valvular heart disease. A report of the American College of Cardiology/American Heart Association Task Force on Practice Guidelines (Writing committee to revise the 1998 guidelines for the management of patients with valvular heart disease). J Am Coll Cardiol 2006; 48:e1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
